//  From Dane --- Example with adding rows (from RTS)

const { table1, image1, text1, text2, input1, text3, input2, text4, input3, button1 } = components;

// const readOrder = [text1, table1, image1, text2, input1, text3, input2, text4, input3, button1];

const id1 = "slide-102b2e9edb49";

const createTableCell = (value) => ({
  editable: false,
  math: !isNaN(value),
  value,
});

const createTableRowsData = (rows) => rows.map((row) => row.map(createTableCell));

button1.updateData({ align: "right" });

autorun(() => {
  if (
    input1.data.text != input1.data.last ||
    input2.data.text != input2.data.last ||
    input3.data.text != input3.data.last
  ) {
    button1.updateData({ text: "Submit", disabled: !input1.data.text });
    input1.updateData({ last: input1.data.text });
    input2.updateData({ last: input2.data.text });
    input3.updateData({ last: input3.data.text });
  }
});

button1.on("click", () => {
  button1.updateData({ text: "Submitted", disabled: true });
});

function discardOldResponses(register) {
  const devices = new Set();

  return register
    .sort((a, b) => b.info.timestamp - a.info.timestamp) // Sort by timestamp (descending)
    .filter(({ info: { device } }) => {
      const deviceHasPreviousAnswer = devices.has(device); // Has device appeared before?
      devices.add(device); // Mark device as appeared

      return !deviceHasPreviousAnswer;
    });
}

setLoadingImage(image1);

function setLoadingImage(imageComp) {
  imageComp.updateData({
    src: "https://prod-dp-digital-lessons-authoring-backend-media.s3.amazonaws.com/3dfc4c76-d5dc-4dfa-a9b6-db83e0a68883",
    alt: "The image is loading",
  });
}

const defaultImage = setDefaultImage();

utils.RTS.on("datachange", "slide-102b2e9edb49", (register) => {
  updateImageFromGGB(image1, defaultImage, register);

  if (!register || !register.length) {
    return;
  }

  const lastRegister = discardOldResponses(register).reverse();

  let xValues6 = [];
  let yValues6 = [];

  lastRegister.forEach(({ data, info }) => {
    const { distance, remaining } = data;
    xValues6.push(distance);
    yValues6.push(remaining);
    for (let j = 0, L = xValues6.length; j < L; j++) {
      let matches = 0;
      for (let i = 0, M = table1.data.rows.length; i < M; i++) {
        let xCheck = table1.getCell(i, 0).value;
        if (xCheck == xValues6[j]) {
          matches++;
        }
      }
      if (matches == 0) {
        let newRow = createTableRowsData([[`${xValues6[j]}`, `${yValues6[j]}`]]);
        let allRows = [...table1.data.rows, ...newRow];
        table1.updateData({ rows: allRows });
      }
    }
  });
});

function updateImageFromGGB(compName, defImage, register) {
  // Don't do anything if we don't have data
  if (!register || !register.length) {
    compName.updateData({
      src: defImage.src,
      alt: defImage.alt,
    });
    return;
  }
  const lastRegister = discardOldResponses2(register).reverse(); // reversing so older responses are first

  lastRegister.forEach(({ data }) => {
    const { imageData } = data; // destructuring assignment, like for components
    compName.updateData({
      src: imageData.src,
      alt: imageData.alt,
    });
  });

  //edited function to filter and keep only student's own and most recent response in lastRegister
  function discardOldResponses2(register) {
    const devices = new Set();

    return register
      .sort((a, b) => b.info.timestamp - a.info.timestamp) // Sort by timestamp (descending)
      .filter(({ info: { isSelf } }) => isSelf)
      .filter(({ info: { device } }) => {
        const deviceHasPreviousAnswer = devices.has(device); // Has device appeared before?
        devices.add(device); // Mark device as appeared
        return !deviceHasPreviousAnswer;
      });
  }
}

